import React, { useState, createContext } from "react";
import "./App.css";
import Header from "../Header/header";
import Modal from "../Modal/modal";

interface IState {
  modal: boolean;
  setModal: Function;
  changedLogging: Function;
  destination: string;
  adress: string;
  url: string;
  residents: number;
  hotels: number;
  AvgPay: number;
  Superficy: number;
}

export const AppContext = createContext<IState | any>({});

const App = () => {
  const [modal, setModal] = useState<boolean>(false);
  const changedLogging: Function = (): void => {
    setModal(!modal);
    console.log("apres set modale", modal);
  };
  return (
    <div className='App'>
      <AppContext.Provider value={{ changedLogging }}>
        <Header />
        {modal && <Modal />}
      </AppContext.Provider>
    </div>
  );
};

export default App;
